import './App.css';
import HeaderAppBar from './components/HeaderAppBar';
import { AuthContextProvider } from './components/contexts/AuthContext';
import StocksDisplay from './components/recommendator/StocksDisplay';

function App() {
  return (
    <AuthContextProvider>
      <div className="App">
        <HeaderAppBar/>
        <StocksDisplay/>
      </div>
    </AuthContextProvider>

  );
}

export default App;
